from runners.python import SubmissionPy

import re


class MathieuSubmission(SubmissionPy):

    def run(self, s):
        # :param s: input in string format
        # :return: solution flag
        # Your code goes here
        alphabet = "azertyuiopqsdfghjklmwxcvbn"
        almighty_regex = r'Aa|Zz|Ee|Rr|Tt|Yy|Uu|Ii|Oo|Pp|Qq|Ss|Dd|Ff|Gg|Hh|Jj|Kk|Ll|Mm|Ww|Xx|Cc|Vv|Bb|Nn|aA|zZ|eE|rR|tT|yY|uU|iI|oO|pP|qQ|sS|dD|fF|gG|hH|jJ|kK|lL|mM|wW|xX|cC|vV|bB|nN'
        min_size = None
        for letter in alphabet:
            new_s = s.replace(letter, "").replace(letter.upper(), "")

            cur_size = len(new_s)
            new_s = re.sub(almighty_regex, '', new_s)

            while len(new_s) != cur_size:
                cur_size = len(new_s)
                new_s = re.sub(almighty_regex, '', new_s)

            if min_size is None:
                min_size = len(new_s)
            else:
                min_size = min(min_size, len(new_s))
        return min_size

if __name__ == '__main__':
    s=""""""
    print(MathieuSubmission().run(s))